def unicodecleaner(L):
    Q = []
    for w in L:
        a = w.replace(u'\u0153', 'oe')
        b = a.replace(u'\u2019', '\'')
        c = b.replace(u'\u0152', 'OE')
        Q.append(c)
    return Q

